import React, { useEffect } from 'react';
import Typed from 'typed.js';
import AOS from 'aos';
import 'aos/dist/aos.css';
import '../HomePage/Homepage.css';
import sports from '../Image/sports.jpeg';
import Homepagebg from '../Image/bg.png';
import otherActivity from '../Image/otherActivity.jpg';
import furniture from '../Image/furniture.jpg';

function HomePage() {

    useEffect(() => {
        const typed = new Typed(".auto-type", {
            strings: ["quality education", "dedicated faculty"],
            typeSpeed: 100,
            backSpeed: 150,
            loop: true,
        });


        return () => {
            typed.destroy();
        };
    }, []);
        useEffect(() => {
          AOS.init();
        }, [])

    return (
        <>
            <div className="Homepage-Box" >
                <img src={Homepagebg} alt='' className='homeBg z-1 w-full h-full absolute' />
                <div className="homePageContentBox font-Quicksand" >
                    <h1>We provide <span className="auto-type"></span></h1>
                    <br/>
                    <h2 data-aos="fade-up" className='font-Quicksand'>Savitri Krishna Senior Secondary School-</h2>
                    <h2 data-aos="fade-up" className='font-Quicksand'>Nurturing Minds, Inspiring Futures</h2>
                </div>

            </div>
            <div className="Homepage2-Box h-fit p-10 flex flex-col items-center justify-around">
                <h1 className='text-center text-white pt-10' data-aos="fade-up">Facilities</h1>
                <div className=" w-full h-fit flex flex-row align-middle justify-evenly mt-10 flex-wrap ">
                    {CardData.map((A) => (
                  <div class="relative flex bg-clip-border rounded-xl bg-white text-gray-700 shadow-md w-full max-w-[48rem] flex-row">
                  <div
                    class="relative w-2/5 m-0 overflow-hidden text-gray-700 bg-white rounded-r-none bg-clip-border rounded-xl shrink-0">
                    <img
                      src="https://images.unsplash.com/photo-1522202176988-66273c2fd55f?ixlib=rb-4.0.3&amp;ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&amp;auto=format&amp;fit=crop&amp;w=1471&amp;q=80"
                      alt="card-image" class="object-cover w-full h-full" />
                  </div>
                  <div class="p-6">
                    <h6
                      class="block mb-4 font-sans text-base antialiased font-semibold leading-relaxed tracking-normal text-gray-700 uppercase">
                      startups
                    </h6>
                    <h4 class="block mb-2 font-sans text-2xl antialiased font-semibold leading-snug tracking-normal text-blue-gray-900">
                      Lyft launching cross-platform service this week
                    </h4>
                    <p class="block mb-8 font-sans text-base antialiased font-normal leading-relaxed text-gray-700">
                      Like so many organizations these days, Autodesk is a company in
                      transition. It was until recently a traditional boxed software company
                      selling licenses. Yet its own business model disruption is only part of
                      the story
                    </p>
                    <a href="#" class="inline-block"><button
                        class="flex items-center gap-2 px-6 py-3 font-sans text-xs font-bold text-center text-gray-900 uppercase align-middle transition-all rounded-lg select-none disabled:opacity-50 disabled:shadow-none disabled:pointer-events-none hover:bg-gray-900/10 active:bg-gray-900/20"
                        type="button">
                        Learn More<svg xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor"
                          stroke-width="2" class="w-4 h-4">
                          <path stroke-linecap="round" stroke-linejoin="round" d="M17.25 8.25L21 12m0 0l-3.75 3.75M21 12H3"></path>
                        </svg></button></a>
                  </div>
                </div>  ))}
                </div>
            </div>

        </>
    )
}


export default HomePage

const CardData = [
    {
        img: otherActivity,
        title: 'curriculum activities',
        line1: "Athletic Development",
        line2: "Fitness and Recreation Center",
        line3: "Leadership Service",
    },
    {
        img: sports,
        title: 'sports',
        line1: "Creative Arts Hub",
        line2: "Language and Literature Corner",
        line3: "Outdoor Sporting Spaces",
    },
    {
        img: furniture,
        title: 'Classrooms',
        line1: "modern classrooms",
        line2: "collaborative spaces",
        line3: "ergonomic furniture",
    }
]
